import React from 'react';
import {Div, Header, Img, StyledCard, H2} from './posts';
import {HeartOutlined, SaveOutlined} from "@ant-design/icons";

const Posts = () => {
    return (
        <Div>
            <Header>username</Header>
            <StyledCard
                hoverable
                cover={<Img alt="example" src={process.env.PUBLIC_URL + '/Img/main-logo.png'} />}
            >
                <Div flex>
                    <HeartOutlined />
                    <SaveOutlined />
                </Div>
                <Div content>
                    <H2>posts content</H2>
                </Div>
            </StyledCard>
        </Div>
    );
};

export default Posts;
